      | 48526 -> { ItemTypeData.id= 48526; name= "Ragnarok Chainbreaker Khumaak SKIN (Permanent)"; published= true; description= "An instrument of liberation, most strikingly known as a weapon to crush the heads of slavers and a tool to break the chains of slaves, the Khumaak is celebrated as the symbol of the Great Rebellion and Minmatar freedom from Amarr domination.    The Khumaak (literally  Hand of Maak ) is a replica of an ancient Amarrian relic used over 400 years ago by the Minmatar slave Drupar Maak to kill his master, Arkon Ardishapur, on Arzad II. The legend says that Maak was inspired in his struggle for freedom by a vision of Holder Arzad, an Amarr noble who had treated his Starkmanir subjects with dignity. Arzad is said to have told Maak:  The fire in our hearts burns for salvation, redemption, and grace. May the Word of God grant you the courage to save yourself and your people.     Maak's killing of the Ardishapur heir sparked a revolt on Arzad II, also known as Starkman Prime. The slaying of Arkon Ardishapur was met with the brutal crushing of the revolt and almost total annihilation of the Starkmanir Tribe by orbital bombardment. The Starkmanir Rebellion preceded the Great Rebellion by over 250 years but its impact is held by historians to have been a major factor in the development of the underground slave movements that would ultimately fight for their freedom in 20 BYC (AD 23216)."; marketGroupId= Some(2093); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48720 -> { ItemTypeData.id= 48720; name= "Osprey Combat Medic Section SKIN (Permanent)"; published= true; description= "For certain tasks, CONCORD forces will use many of the ship designs of the four empires, and dedicated combat medic vessels are usually adaptations of the various repair and recovery cruisers manufactured by empire corporations.    The Combat Medic Sections will accompany DED forces on search and rescue duty along spacelanes where piracy is commonplace and often the only practical action that can be taken is recovery of survivors."; marketGroupId= Some(1991); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48817 -> { ItemTypeData.id= 48817; name= "Gila Storm Bear SKIN (Permanent)"; published= true; description= "Caldari Prime's climate is renowned for being colder than most temperate worlds, but the large polar and subpolar regions are frigid indeed. The huge swathes of territory circled around the poles contain various biomes, including vast tundras, but the taigas of the subpolar belts are iconic in Caldari culture and mythology. The most charismatic of the fauna inhabiting these belts are the great bears of Caldari Prime. In the northern taiga, the Storm Bear reigns supreme, a creature larger than any other predator save the Emperor Bears of the southern polar archipelagos.    The realm of the Storm Bear is far more mountainous than the southern islands and is known for the sky-wracking storms that sweep the forested slopes of the region. The Storm Bear, also called  Thunder Bear  in some Caldari animist traditions, takes its name from its rain-cloud grey pelt and its complete fearlessness, even in the face of the wind, rain and lightning of the greatest mountain storms."; marketGroupId= Some(2030); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
